import Link from "next/link";

const Navigation = () => (
  <nav>
    <Link href="/">
      <a>Ke Home</a>
    </Link>
    <Link href="/blog">
      <a>Ke Blog</a>
    </Link>
  </nav>
);

export default Navigation;
